import React from 'react';
import { Input } from 'semantic-ui-react'

function Login() {
    var User = document.getElementsByClassName('Users')
    var Passwd = document.getElementsByClassName('Password')
    const LoginInfo = { "User": "Admin", "Password": "Admin" }
    if (LoginInfo['User'] === User && LoginInfo['Password'] === Passwd) {
        alert('오 님은 DevStorm 님이시군요!')
    }
    else {
        alert('오 님은 안됨')
    }
}

function Society() {
    return (
        <div className='Society'>
            <Input type='text' className='Users' />
            <Input type='text' className='Password' />
            <Input type='submit' onClick={Login} />
        </div>
    );
}

export default Society;
